We have customers all around the words. For example, airports and ground handlers in such cities like Berlin, Frankfurt, Lyon, Dublin, Jakarta, Beijing and so on.
In Beiing, we''re providing software for Beijing Daxing International Airport which is going to become the biggest airport in the world.

Our software covers most of needs of airports. Here is list of major modules of our solutions:
- Seasonal flight schedule.
- Operational flight schedule.
- Resource management covering all resources that an airport has. This module includes algorithms for auto-allocation and optimization for limited resources.
- Display management
- Billing
- Reporting and Analytics (BI) and so on

Major part of listed modules are adapted for ground handlers. Additionally, we developed a few web applications adapted for mobile devices which are used by employees servicing aircrafts.

Another major part of our clients are airport coordinators. They are orginazations communicating with airlines and airports nationwide in order to form a season schedule for each coordinated airport in a country. 
Their work is based on IATA standards about slot coordination.

